// import './App.css';
import {BrowserRouter, Route} from "react-router-dom";
import Frame from "./components/frame";

function App() {
    return (
        <div className="App">
            <BrowserRouter>
                <Route path={"/home"} component={Frame}></Route>
            </BrowserRouter>
        </div>
    );
}

export default App;
